import React, { useState } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import Google from './components/googleLogin'
import InputCollaborateur from './components/inputCollaborateur';
import Rh from './components/rh'



function App() {

  const [nomPrenom, setNomPrenom] = useState('')
  console.log(nomPrenom, ' State APPS JS');
  const handleNomPrenom = nomPrenom => { setNomPrenom(nomPrenom) }

  return (
    <Router>
      <div>
        <Switch>
          <Route exact path='/'><Google nomPrenom={nomPrenom => handleNomPrenom(nomPrenom)
          } /></Route>
          {/* <Route exact path='/redirect/:email'><Redirection /></Route> */}
          <Route exact path='/collaborateur/:prenom/:nom'><InputCollaborateur nomPrenom={nomPrenom} /></Route>
          <Route exact path='/rh'><Rh /></Route>}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
